import React from "react";
import PropTypes from "prop-types";
import "./style.css"; // 스타일 파일 경로 확인

export const LogoDefault = ({ className, icon }) => {
  return (
    <div className={`logo-default ${className || ""}`}>
      <img src={icon} alt="Logo Icon" className="icon" />
      <div className="text-wrapper">PoliTracker</div>
    </div>
  );
};

LogoDefault.propTypes = {
  className: PropTypes.string,
  icon: PropTypes.string.isRequired,
};

LogoDefault.defaultProps = {
  className: "",
};
